import React from "react";

export const CheckBox = ({name, label, options}) => {
  return (
    <div class="form-check">
      <label htmlFor=""></label>
      <input
        class="form-check-input"
        type="checkbox"
        value=""
        id="flexCheckDefault"
      />
      <label class="form-check-label" for="flexCheckDefault">
       {label}
      </label>
    </div>
  );
};
